--  DDL for View PLAN_MANTENIMIENTO_DETALLADO
--------------------------------------------------------

  CREATE OR REPLACE FORCE NONEDITIONABLE VIEW "AMARTINEZG"."PLAN_MANTENIMIENTO_DETALLADO" ("KILOMETROS", "DESCRIPCION") AS 
  select KILOMETROS,DESCRIPCION from ITEMS_MANTO;
--------------------------------------------------------
--  DDL for View TARIFA_DESTINO
--------------------------------------------------------

  CREATE OR REPLACE FORCE NONEDITIONABLE VIEW "AMARTINEZG"."TARIFA_DESTINO" ("ORIGEN", "ID_DESTINO", "CENTRO_RECIBO", "MUNICIPIO", "PRECIO") AS 
  select m.NOMBRE as origen,t.ID_DESTINO as ID_Destino,t.ID_CENTRO_RECIBO as CENTRO_RECIBO,m.NOMBRE as municipio,t.ID_PRECIO as precio  FROM TARIFAS t inner join CENTROS_RECIBO c on 
 t.ID_CENTRO_RECIBO = c.ID_CENTRO_RECIBO inner join MUNICIPIOS m on 
 t.ID_DESTINO=m.ID_MUNICIPIO inner join 
 MUNICIPIOS on c.ID_MUNICIPIO=m.ID_MUNICIPIO;
--------------------------------------------------------
--  DDL for View TARIFA_DESTINO2
--------------------------------------------------------

  CREATE OR REPLACE FORCE NONEDITIONABLE VIEW "AMARTINEZG"."TARIFA_DESTINO2" ("ORIGEN", "ID_DESTINO", "DESTINO", "PRECIO") AS 
  select m.NOMBRE as origen,t.ID_DESTINO as ID_Destino,MUNICIPIOS.NOMBRE as destino,t.ID_PRECIO as precio  FROM TARIFAS t inner join CENTROS_RECIBO c on 
 t.ID_CENTRO_RECIBO = c.ID_CENTRO_RECIBO inner join MUNICIPIOS m on 
 t.ID_DESTINO=m.ID_MUNICIPIO inner join 
 MUNICIPIOS on c.ID_MUNICIPIO=m.ID_MUNICIPIO;
